At line ####, this.styleAdapters.elementAt(index) should be validAdapters.get(index).

Major severity because this can be a cause of infinite loop as following scenario:
 - item(i) invokes modelProvided event
 - some listener schedules to update a viewer
 - the viewer (can indirectly) invokes HTLMDocumentAdapter.item(i) to get style
 - item(i) invoked modelProvided event again....

