Within a stacked area chart, I tried to modify the Y-axis as follows and it was ignored.  Could you please add this capability to BIRT?

importPackage(Packages.org.eclipse.birt.chart.model);
importPackage(Packages.org.eclipse.birt.chart.model.data);
importPackage(Packages.org.eclipse.birt.chart.model.data.impl);

function afterRendering( gcs, context) {
  chart = gcs.getChartModel();

  if (chart instanceof ChartWithAxes) {
    chart = ChartWithAxes(chart);
    axBase = chart.getPrimaryBaseAxes()[0];
    axis = chart.getOrthogonalAxes(axBase, true)[0];
    //
    // Set y-axis to have max value of 2,000 and step size of 250
    //
    min = NumberDataElementImpl.create(0.0);
    max = NumberDataElementImpl.create(2000.0);
    axis.getScale().setMin(min);
    axis.getScale().setMax(max);
    axis.getScale().setStep(250.0);
  }
}

AfterRendering will be triggered after the chart has rendered, so it can't modify it.

Try the following instead: 

function beforeGeneration( chart, context) {

    axBase = chart.getPrimaryBaseAxes()[0];
    axis = chart.getOrthogonalAxes(axBase, true)[0];
    //
    // Set y-axis to have max value of 2,000 and step size of 250
    //
    min = NumberDataElementImpl.create(0.0);
    max = NumberDataElementImpl.create(2000.0);
    axis.getScale().setMin(min);
    axis.getScale().setMax(max);
    axis.getScale().setStep(250.0);

}

