~~~~~~~~~~~~~~~~~~~~~
// Here's my interface
public interface Iface {
   public void method(int a, float b);
};

// One class that implements this interface
public class ImplementorA implements Iface {
   public void method(int a, float b)
   {
      System.out.println("ImplementorA.method was run");
   }

// Another class that implements this interface
public class ImplementorB implements Iface {
   public void method(int a, float b)
   {
      System.out.println("ImplementorB.method was run");
   }

// Now, a class that uses the interface
public class User {
   static void main(...) {
      IFace impl = new ImplementorB();
      impl.method(1, 1.1);
   }
}
~~~~~~~~~~~~~~~~~~~~~
OK, so in the editor, when I'm looking at class User, if I right click on the call to impl.method, and select Open Declaration, I go to what's defined in inteface Iface.

In a large body of code, I don't always know if the method I'm opening is part of an interface or abstract class...I just want to go visit the code that's going to be called.  When "open declaration" is used on a method that is abstract or part of an interface, the suggestion is to present the user with a list of classes that implement that method, and let him pick the one he wants to go visit.
